import React from 'react'
import Box  from '../Utilities/Box'

function SupportPage() {
  return (
    <div id='support' className='p-8'>
      <header className='text-3xl'>Support Us by</header>
        <Box header={'Inviting Other People'}/>
    </div>
  )
}

export default SupportPage
